type CircleProps = {
     leftColor: string;
     rightColor: string;
     isHovered: boolean;
};

export const GradientCircle = ({ leftColor, rightColor, isHovered }: CircleProps) => {
     const id = leftColor.slice(1) + rightColor.slice(1);
     return (
          <svg
               className="circle"
               // width="806"
               // height="807"
               viewBox="0 0 807 807"
               fill="none"
               xmlns="http://www.w3.org/2000/svg"
          >
               <linearGradient id={id} x1="0%" y1="0%" x2="100%" y2="0%">
                    <stop
                         offset="0%"
                         style={{
                              // stopColor: "#60efff",
                              stopColor: leftColor,
                              stopOpacity: 1,
                         }}
                    />
                    <stop
                         offset="100%"
                         style={{
                              // stopColor: "#0061ff",
                              stopColor: rightColor,
                              stopOpacity: 1,
                         }}
                    />
               </linearGradient>

               <circle
                    cx="403.5"
                    cy="403.5"
                    r="403.5"
                    // fill="#0872F5"
                    filter={isHovered ? 'saturate(180%) blur(5px)' : ''}
                    fill={`url(#${id})`}
               />
          </svg>
     );
};

